var t=Ember.HTMLBars.template({id:"2HNJ5MSP",block:'{"symbols":[],"statements":[[7,"div",true],[10,"class","docs-md"],[8],[7,"h1",true],[10,"id","what-are-engines-"],[10,"class","docs-md__h1"],[8],[0,"What are Engines?"],[9],[0,"\\n    "],[7,"p",true],[8],[0,"Engines allow multiple logical applications to be composed together into a single application from the user\'s perspective. The key term here is \\"logical application\\". That is, an Engine represents a set of functionality and user experiences that could logically be considered an application. However, they differ from normal Ember applications in that they are intended to be composed within a host application in order to create a single, cohesive user experience."],[9],[0,"\\n"],[7,"p",true],[8],[0,"On a technical level, engines and applications are remarkably similar: they each have their own container, registry, context, and namespace. However, unlike an application, an engine does not boot itself nor does it control its own router. Engines rely on their hosts to fulfill these responsibilities."],[9],[0,"\\n"],[7,"p",true],[8],[0,"The often used example of this is a \\"blogging\\" application. While a blog itself could be a full-fledged application, you may also wish to use it as a specific subsection of your overall application. If you threw a \\"news feed\\" engine into that mix, you might get an application structure that looks something like this:"],[9],[0,"\\n"],[7,"img",true],[10,"src","/images/app-engine-diagram.jpeg"],[10,"alt","Diagram of Application with two Engines"],[10,"width","850"],[8],[9],[0,"\\n\\n"],[7,"p",true],[8],[0,"This host application relies upon Engines to control different \\"zones\\" of functionality. However, from the user\'s perspective, the host application and its engines appear to be a single application."],[9],[0,"\\n\\n      "],[7,"h2",true],[10,"id","why-use-engines-"],[10,"class","docs-md__h2"],[8],[7,"a",true],[10,"href","#why-use-engines-"],[10,"class","heading-anchor"],[8],[0,"Why use Engines?"],[9],[9],[0,"\\n    "],[7,"p",true],[8],[0,"Large organizations often use Ember.js to power sophisticated web applications. These apps may require collaboration among several teams, sometimes distributed around the world. Typically, responsibility is shared by dividing the application into one or more \\"sections\\". How this division is actually implemented varies from team to team."],[9],[0,"\\n"],[7,"p",true],[8],[0,"Maintaining large monolithic applications poses the following challenges:"],[9],[0,"\\n"],[7,"ul",true],[8],[0,"\\n"],[7,"li",true],[8],[7,"code",true],[8],[0,"Side effects"],[9],[0," - if you change something, it may be unclear how it could affect the rest of platform."],[9],[0,"\\n"],[7,"li",true],[8],[7,"code",true],[8],[0,"Coordination"],[9],[0," - when you develop a new feature or make big changes, many teams may need to be in sync to approve it."],[9],[0,"\\n"],[7,"li",true],[8],[7,"code",true],[8],[0,"Complexity"],[9],[0," - with a huge dependency tree and many layers of abstraction, developers cannot iterate quickly, and features suffer as a result."],[9],[0,"\\n"],[7,"li",true],[8],[7,"code",true],[8],[0,"Killing Innovation"],[9],[0," - a/b testing a cutting-edge feature is hard to do without disrupting the rest of the app and the teams working on it."],[9],[0,"\\n"],[7,"li",true],[8],[7,"code",true],[8],[0,"Slow Onboarding"],[9],[0," - new people coming into the team are overwhelmed."],[9],[0,"\\n"],[9],[0,"\\n"],[7,"p",true],[8],[0,"Engines provide an antidote to these problems by allowing for distributed development, testing, and packaging of logically-grouped pieces of an application."],[9],[0,"\\n"],[7,"p",true],[8],[0,"Engines are good for organizations that have multiple teams, where each team has their own area that is clearly separated from the others. The isolation is good when it matches organizational boundaries, but adds unnecessary complexity when there is not a good match."],[9],[0,"\\n"],[7,"p",true],[8],[0,"Engines are used by a number of organizations, including "],[7,"a",true],[10,"href","https://www.linkedin.com"],[10,"class","docs-md__a"],[8],[0,"LinkedIn"],[9],[0,", "],[7,"a",true],[10,"href","https://www.chase.com/"],[10,"class","docs-md__a"],[8],[0,"Chase"],[9],[0,", and "],[7,"a",true],[10,"href","https://squareup.com"],[10,"class","docs-md__a"],[8],[0,"Square"],[9],[0,", to power sites with million of users."],[9],[0,"\\n"],[7,"p",true],[8],[0,"If you are considering splitting up your application into engines just to reduce the amount of data that needs to be initially downloaded and increase the performance, Engines are not the right solution. Please check out the section on tree shaking and code splitting in projects like "],[7,"a",true],[10,"href","https://github.com/embroider-build/embroider"],[10,"class","docs-md__a"],[8],[0,"Embroider"],[9],[0,"."],[9],[9]],"hasEval":false}',meta:{moduleName:"dummy/templates/docs/index.hbs"}})
